import User from '@minchat/js/dist/user'
import React, { useEffect, useState } from 'react'
import MinChat, { Chat } from '.'
import MinChatContext from './MinChatContext'

type Props = {
    apiKey: string | number
    children?: any
    user: User
    demo?: boolean
    test?: boolean
}

export default function MinChatProvider({
    apiKey,
    children,
    user = { name: undefined, avatar: undefined, id: "1" },
    demo = false,
    test = false,
}: Props) {

    const [minChat, setMinChat] = useState(MinChat.getInstance(apiKey).connectUser(user))

    // keeps track of whether the config of the minchat object has been setup with required props
    const [minChatConfigured, setMinChatConfigured] = useState(false)

    // is called to reorder the chats array when a new message is sent or recieved 
    const [updateChatOrder, setUpdateChatOrder] = useState(0)

    //keeps track of he chat objects (conversations)
    const [chats, setChats] = useState<Chat[]>()

    useEffect(() => {
        setMinChat(value => {
            value.instance.config.demo = demo
            value.instance.config.test = test

            return value
        })

        setMinChatConfigured(true)
    }, [demo, test])

    useEffect(() => {
        if (user) {
            setMinChat(value => {
                value.connectUser(user)
                return value
            })

        }
    }, [user])

    return <MinChatContext.Provider value={{
        minChat,
        updateChatOrder,
        setUpdateChatOrder,
        minChatObjectAssigned: minChatConfigured,
        chats,
        setChats
    }} >{children}</MinChatContext.Provider>

}

